import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './index.css';
import {Link} from 'react-router-dom';




function DeasFiveComponent() {
    return (
        <div>
         <h3 className='center3'>Interview</h3>
            <h5>ENG</h5>
             <Link to="/inter/one">
                <button className='b1'>
                Preparing for Interview
                </button>
            </Link>
            <h5>KAZ</h5>
            <Link to="/inter/two">
                <button className='b2'>
                Интервьюге дайындық                </button>
            </Link>
            <h5>RUS</h5>
            <Link to="/inter/three">
                <button className='b3'>
                Подготовка к собеседованию                </button>
            </Link>

        </div>
    );
}

export default DeasFiveComponent;
